INSERT INTO "django_admin_log" VALUES(269,'143','The thought manifests itself as the word.  The word manifests as the deed.  The deed develops into habit.  Habit hardens into character.  So watch the thought and its way with care, and let it spring ',1,'[{"added": {}}]',7,1,'2016-09-13 16:23:45.416946');
