INSERT INTO "django_admin_log" VALUES(277,'147','Categories such as time, space, cause and number represent the most general relations which exist between things; surpassing all our other ideas in extension, they dominate all the details of our inte',1,'[{"added": {}}]',7,1,'2016-10-22 13:22:15.463067');
