INSERT INTO "django_admin_log" VALUES(280,'148','It is a principle that shines impartially on the just and the unjust that once you have a point of view all history will back you up.',1,'[{"added": {}}]',7,1,'2016-10-22 13:26:55.686465');
INSERT INTO "django_admin_log" VALUES(281,'149','The rage for wanting to conclude is one of the most deadly and most fruitless manias to befall humanity.  Each religion and each philosophy has pretended to have God to itself, to measure the infinite',1,'[{"added": {}}]',7,1,'2016-10-22 13:28:54.934269');
