INSERT INTO "django_admin_log" VALUES(303,'162','All is interrelated.  Heaven and earth, air and water.  All are but one thing; not four, not two and not three, but one.  Where they are not together, there is only an incomplete piece.',1,'[{"added": {}}]',7,1,'2017-03-16 12:09:49.715082');
