INSERT INTO "django_admin_log" VALUES(307,'164','The foolish reject what they see and not what they think; the wise reject what they think and not what they see.',1,'[{"added": {}}]',7,1,'2017-05-02 18:04:25.973695');
INSERT INTO "django_admin_log" VALUES(308,'165','Remind yourself that it is not the future or what has passed that afflicts you, but always the present.',1,'[{"added": {}}]',7,1,'2017-05-18 18:25:04.390059');
INSERT INTO "django_admin_log" VALUES(309,'166','What''s gone and what''s past help should be past grief. (The Winter''s Tale)',1,'[{"added": {}}]',7,1,'2017-05-18 18:33:05.955200');
INSERT INTO "django_admin_log" VALUES(310,'167','All disturbances arise solely from the opinions within us.',1,'[{"added": {}}]',7,1,'2017-05-18 18:36:02.781317');
INSERT INTO "django_admin_log" VALUES(311,'168','The robbed that smiles, steals something from the thief. (Othello)',1,'[{"added": {}}]',7,1,'2017-05-18 18:43:37.648404');
INSERT INTO "django_admin_log" VALUES(312,'169','As if you had died and your life had extended only to this present moment, use the surplus that is left to you to live from this time onward according to nature.',1,'[{"added": {}}]',7,1,'2017-05-18 18:44:55.859697');
INSERT INTO "django_admin_log" VALUES(313,'170','I wasted time and now doth time waste me. (Richard II)',1,'[{"added": {}}]',7,1,'2017-05-18 18:47:46.487340');
INSERT INTO "django_admin_log" VALUES(314,'171','Refer your action to no other end than the common good.',1,'[{"added": {}}]',7,1,'2017-05-18 18:48:38.387287');
INSERT INTO "django_admin_log" VALUES(315,'172','Love all, trust a few, do wrong to none. (All''s Well That Ends Well)',1,'[{"added": {}}]',7,1,'2017-05-18 18:50:08.432962');
INSERT INTO "django_admin_log" VALUES(316,'173','Reputation is an idle and most false imposition, oft got without merit and lost without deserving.  You have lost no reputation at all unless you repute yourself such a loser.  (Othello)',1,'[{"added": {}}]',7,1,'2017-05-18 18:52:24.703882');
