INSERT INTO "daily_digest_quote" VALUES(11,'There''s nothing more important than our good health - that''s our principal capital asset.','2016-08-31 01:58:19',2,0,9,'','2016-12-12 11:56:24');
INSERT INTO "daily_digest_quote" VALUES(12,'Most folks are as happy as they make up their minds to be.','2016-08-31 01:59:50',2,0,10,'','2016-12-09 11:56:39');
INSERT INTO "daily_digest_quote" VALUES(13,'Either you run the day or the day runs you.','2016-08-31 02:01:13',2,0,11,'','2017-02-02 12:54:37');
INSERT INTO "daily_digest_quote" VALUES(14,'The secret of getting ahead is getting started.','2016-08-31 02:02:31',2,0,12,'','2016-12-29 11:56:35');
INSERT INTO "daily_digest_quote" VALUES(15,'There is nothing on this earth more to be prized than true friendship.','2016-08-31 02:03:55',2,0,13,'','2017-01-01 11:59:53');
INSERT INTO "daily_digest_quote" VALUES(16,'Happiness is not something ready made. It comes from your own actions.','2016-08-31 02:05:49',2,0,14,'','2016-12-31 11:56:31');
INSERT INTO "daily_digest_quote" VALUES(17,'Happiness is good health and a bad memory.','2016-08-31 02:06:55',2,0,15,'','2016-12-13 11:56:28');
