INSERT INTO "daily_digest_quote" VALUES(30,'We get paid for bringing value to the marketplace. It takes time to bring value to the marketplace, but we get paid for the value, not the time.','2016-08-31 04:05:15',2,0,11,'','2016-12-26 11:56:25');
INSERT INTO "daily_digest_quote" VALUES(31,'Always act in a way that increases the options.','2016-08-31 04:06:42',2,0,24,'','2016-12-23 11:56:36');
