INSERT INTO "daily_digest_quote" VALUES(33,'You have your way. I have my way. As for the right way, the correct way, and the only way, it does not exist.','2016-08-31 04:09:27',2,0,26,'','2016-12-22 11:56:36');
INSERT INTO "daily_digest_quote" VALUES(34,'A human being should be able to change a diaper, plan an invasion, butcher a hog, conn a ship, design a building, write a sonnet, balance accounts, build a wall, set a bone, comfort the dying, take orders, give orders, cooperate, act alone, solve equations, analyze a new problem, pitch manure, program a computer, cook a tasty meal, fight efficiently, die gallantly. Specialization is for insects.','2016-08-31 04:11:00',2,0,27,'','2017-01-07 12:54:41');
INSERT INTO "daily_digest_quote" VALUES(35,'The language of friendship is not words but meanings.','2016-08-31 04:12:51',2,0,28,'','2017-01-10 12:54:39');
INSERT INTO "daily_digest_quote" VALUES(36,'What can be asserted without evidence can be dismissed without evidence.','2016-08-31 04:14:31',2,0,29,'','2017-03-19 11:52:52');
