INSERT INTO "daily_digest_quote" VALUES(41,'It is the mark of an educated mind to be able to entertain a thought without accepting it.','2016-08-31 04:19:09',2,0,31,'','2017-03-08 12:54:50');
INSERT INTO "daily_digest_quote" VALUES(42,'Great spirits have always encountered violent opposition from mediocre minds.','2016-08-31 04:20:03',2,0,2,'','2017-02-12 12:55:06');
