INSERT INTO "daily_digest_quote" VALUES(130,'Each man must look to himself to teach him the meaning of life.  It is not something discovered, it is something molded.','2016-09-13 01:30:46',1,0,86,'','2016-10-19 11:53:23');
INSERT INTO "daily_digest_quote" VALUES(131,'To change something, build a new model that makes the existing model obsolete.','2016-09-13 03:56:36',1,0,87,'','2017-03-02 12:54:53');
INSERT INTO "daily_digest_quote" VALUES(132,'What would you attempt to do if you knew that you could not fail?','2016-09-13 16:10:40',1,0,88,'','2017-01-27 12:54:43');
