INSERT INTO "daily_digest_quote" VALUES(140,'People are afraid of the future, of the unknown.  If a man faces up to it, and takes the dare of the future, he can have some control over his destiny.  That''s an exciting idea to me, better than waiting with everybody else to see what''s going to happen.','2016-09-13 16:20:42',1,0,95,'','2017-03-09 12:54:53');
INSERT INTO "daily_digest_quote" VALUES(141,'Nothing in life is to be feared.  It is only to be understood.','2016-09-13 16:21:55',2,0,96,'','2016-11-21 11:56:46');
INSERT INTO "daily_digest_quote" VALUES(142,'to be nobody but yourself - in a world which is doing its best, night and day, to make you everybody else - means to fight the hardest battle which any human being can fight, and never stop fighting.','2016-09-13 16:23:12',5,0,97,'','2016-11-19 11:56:39');
INSERT INTO "daily_digest_quote" VALUES(143,'The thought manifests itself as the word.  The word manifests as the deed.  The deed develops into habit.  Habit hardens into character.  So watch the thought and its way with care, and let it spring from love born out of concern for all beings.','2016-09-13 16:23:40',6,0,20,'','2016-12-06 11:56:40');
INSERT INTO "daily_digest_quote" VALUES(144,'We think we believe what we know, but we only truly believe what we feel.','2016-09-13 16:26:10',1,0,98,'','2016-11-23 11:56:38');
INSERT INTO "daily_digest_quote" VALUES(145,'The big lesson in life, baby, is never be scared of anyone or anything.','2016-09-14 18:57:04',4,0,99,'','2016-12-01 11:56:38');
INSERT INTO "daily_digest_quote" VALUES(146,'If you look after truth and goodness, beauty looks after herself.','2016-10-22 13:15:23',9,0,100,'','2016-12-07 11:56:51');
INSERT INTO "daily_digest_quote" VALUES(147,'Categories such as time, space, cause and number represent the most general relations which exist between things; surpassing all our other ideas in extension, they dominate all the details of our intellectual life.  If humankind did not agree upon these essential ideas at every moment, if they did not have the same conception of time, space, cause and number, all contact between their minds would be impossible...','2016-10-22 13:22:11',4,0,101,'','2016-11-28 11:56:36');
INSERT INTO "daily_digest_quote" VALUES(148,'It is a principle that shines impartially on the just and the unjust that once you have a point of view all history will back you up.','2016-10-22 13:26:42',3,0,102,'','2016-11-27 11:56:38');
INSERT INTO "daily_digest_quote" VALUES(149,'The rage for wanting to conclude is one of the most deadly and most fruitless manias to befall humanity.  Each religion and each philosophy has pretended to have God to itself, to measure the infinite and to know the recipe for happiness.  What arrogance and what nonsense!  I see, to the contrary, that the greatest geniuses and the greatest works have never concluded.','2016-10-22 13:28:40',5,0,103,'','2016-11-18 11:56:40');
INSERT INTO "daily_digest_quote" VALUES(150,'For a successful technology, reality must take precedence over public relations, for Nature cannot be fooled.','2016-10-22 13:31:34',7,0,104,'','2016-12-08 11:56:38');
INSERT INTO "daily_digest_quote" VALUES(151,'The future is always beginning now.','2017-01-05 23:32:05',1,0,105,'Alex','2017-03-31 11:52:37');
INSERT INTO "daily_digest_quote" VALUES(152,'Some people die at 25 and aren''t buried until 75.','2017-01-05 23:32:40',1,0,83,'Alex','2017-02-07 12:54:59');
INSERT INTO "daily_digest_quote" VALUES(153,'I believe in looking reality straight in the eye and denying it.','2017-01-07 21:58:47',1,0,106,'Alex','2017-01-24 12:54:51');
INSERT INTO "daily_digest_quote" VALUES(154,'What do you care what other people think?','2017-01-11 14:07:29',1,0,104,'Alex','2017-01-19 12:54:43');
INSERT INTO "daily_digest_quote" VALUES(155,'No more roundabout discussion of what makes a good person.  Be one!  If it is not right, don''t do it; if it is not true, don''t say it.','2017-01-17 00:42:06',1,0,17,'Alex','2017-02-08 12:54:39');
INSERT INTO "daily_digest_quote" VALUES(156,'Nothing in this world is good or bad, but thinking makes it so.','2017-01-18 21:45:36',1,0,107,'Alex','2017-01-29 12:54:38');
INSERT INTO "daily_digest_quote" VALUES(157,'We suffer more in imagination than reality.','2017-01-19 13:05:12',1,0,108,'Alex','2017-01-22 12:54:46');
INSERT INTO "daily_digest_quote" VALUES(158,'Be polite, be professional, but have a plan to kill everybody you meet.','2017-01-21 18:05:32',1,0,109,'Alex','2017-02-06 12:54:54');
INSERT INTO "daily_digest_quote" VALUES(159,'Don''t cling to a mistake just because you spent a lot of time making it.','2017-01-31 23:59:04',1,0,88,'Alex','2017-02-10 12:54:40');
INSERT INTO "daily_digest_quote" VALUES(160,'Life has taught us that love does not consist in gazing at each other but in looking outward together in the same direction.','2017-02-15 14:38:31',1,0,86,'Alex Kelley','2017-03-12 12:54:48');
INSERT INTO "daily_digest_quote" VALUES(161,'Character consists of what you do on the third and fourth tries.','2017-02-28 12:38:19',1,0,110,'Alex Kelley','2017-03-05 12:54:55');
INSERT INTO "daily_digest_quote" VALUES(162,'All is interrelated.  Heaven and earth, air and water.  All are but one thing; not four, not two and not three, but one.  Where they are not together, there is only an incomplete piece.','2017-03-16 12:09:42',1,0,111,'Alex Kelley','2017-03-26 11:52:35');
INSERT INTO "daily_digest_quote" VALUES(163,'To do great work a man must be very idle as well as very industrious.','2017-05-02 18:03:43',1,0,112,'Elizabeth Rogers','2017-05-03 11:52:57');
INSERT INTO "daily_digest_quote" VALUES(164,'The foolish reject what they see and not what they think; the wise reject what they think and not what they see.','2017-05-02 18:04:18',1,0,113,'Elizabeth Rogers','2017-05-04 11:53:01');
INSERT INTO "daily_digest_quote" VALUES(165,'Remind yourself that it is not the future or what has passed that afflicts you, but always the present.','2017-05-18 18:24:56',0,0,17,'Alex Kelley','2017-05-18 18:24:25');
INSERT INTO "daily_digest_quote" VALUES(166,'What''s gone and what''s past help should be past grief. (The Winter''s Tale)','2017-05-18 18:32:58',0,0,107,'Alex Kelley','2017-05-18 18:25:04');
INSERT INTO "daily_digest_quote" VALUES(167,'All disturbances arise solely from the opinions within us.','2017-05-18 18:35:20',0,0,17,'Alex Kelley','2017-05-18 18:33:06');
INSERT INTO "daily_digest_quote" VALUES(168,'The robbed that smiles, steals something from the thief. (Othello)','2017-05-18 18:43:30',0,0,107,'Alex Kelley','2017-05-18 18:36:02');
INSERT INTO "daily_digest_quote" VALUES(169,'As if you had died and your life had extended only to this present moment, use the surplus that is left to you to live from this time onward according to nature.','2017-05-18 18:43:49',0,0,17,'Alex Kelley','2017-05-18 18:43:37');
INSERT INTO "daily_digest_quote" VALUES(170,'I wasted time and now doth time waste me. (Richard II)','2017-05-18 18:47:39',0,0,107,'Alex Kelley','2017-05-18 18:44:56');
INSERT INTO "daily_digest_quote" VALUES(171,'Refer your action to no other end than the common good.','2017-05-18 18:48:32',0,0,17,'Alex Kelley','2017-05-18 18:47:46');
INSERT INTO "daily_digest_quote" VALUES(172,'Love all, trust a few, do wrong to none. (All''s Well That Ends Well)','2017-05-18 18:49:51',0,0,107,'Alex Kelley','2017-05-18 18:48:38');
INSERT INTO "daily_digest_quote" VALUES(173,'Reputation is an idle and most false imposition, oft got without merit and lost without deserving.  You have lost no reputation at all unless you repute yourself such a loser.  (Othello)','2017-05-18 18:52:19',0,0,107,'Alex Kelley','2017-05-18 18:50:08');
INSERT INTO "daily_digest_quote" VALUES(174,'Do little, if you want contentment of mind.','2017-05-18 18:53:05',0,0,17,'Alex Kelley','2017-05-18 18:52:24');
INSERT INTO "daily_digest_quote" VALUES(175,'Wisely and slow; they stumble that run fast.  (Romeo and Juliet)','2017-05-18 18:53:52',0,0,107,'Alex Kelley','2017-05-18 18:53:10');
INSERT INTO "daily_digest_exercise" VALUES(1,'Hindu Pushup','Set your feet wider than hips.  Bend over into a downward facing dog with hands wider than shoulders on the floor.  Drive your head down and through your hands into an upward facing dog.  Return to starting position and repeat 20 times.','https://www.youtube.com/watch?v=vQsQAiE0NQo',14,0,'2017-05-17 11:57:00');
INSERT INTO "daily_digest_exercise" VALUES(2,'Hollow Rocking','Lay down with arms on the floor straight over head.  Form a banana shape with your body.  Rock slowly up and down.  Repeat 20 times.','https://www.youtube.com/watch?v=Jh4-uLTL4v4',14,0,'2017-05-18 11:53:06');
INSERT INTO "daily_digest_exercise" VALUES(3,'Elbow Plank','Elbows on floor.  Feet wider than hips.  Back straight.  Hold for 60 secs.','https://youtu.be/SkmgmbDhzC8',13,0,'2017-04-30 11:52:40');
INSERT INTO "daily_digest_exercise" VALUES(4,'Back Rolls','Lay on your back and wrap your arms around your knees.  Roll up and back in long slow rolls.  Repeat 20 times.','https://www.youtube.com/watch?v=X_2QlJQOkyc',13,0,'2017-05-01 11:52:59');
INSERT INTO "daily_digest_exercise" VALUES(5,'Sit down / Get up','Sit on the floor.  Stand up without using your hands.  Sit back down without using your hands.  Repeat 10 times.','https://www.youtube.com/watch?v=mNguxqm3o2c',13,0,'2017-05-02 11:53:00');
INSERT INTO "daily_digest_exercise" VALUES(6,'Arm Circles','Do 20 big arm circles forward and 20 more backwards.','https://www.youtube.com/watch?v=Gred163j8U4',13,0,'2017-05-03 11:52:57');
INSERT INTO "daily_digest_exercise" VALUES(7,'Monkey Humpers','While grabbing your ankles, squat down then return to a front bend.  Repeat 20 times.','https://www.youtube.com/watch?v=tKE18uCQBI8',13,0,'2017-05-04 11:53:02');
INSERT INTO "daily_digest_exercise" VALUES(8,'Bear Crawl','Crawl on all fours like a bear with your head up and back parallel to the floor.  Continue for 40 steps.','https://www.youtube.com/watch?v=xqmDWtOtKnY',13,0,'2017-05-05 11:52:55');
INSERT INTO "daily_digest_exercise" VALUES(9,'Squat Hold','Hold a squat with your heels on the floor for 30 seconds.','https://www.youtube.com/watch?v=2IRnH8ygjXs',13,0,'2017-05-06 11:52:53');
INSERT INTO "daily_digest_exercise" VALUES(10,'Knee-to-Elbow Pushup','Take a pushup position.  Bring your left knee towards your right elbow.  Return your foot to starting position and do a pushup.  Switch sides and repeat 20 times.','https://www.youtube.com/watch?v=sLrWVrQGGYc',13,0,'2017-05-07 11:52:58');
INSERT INTO "daily_digest_exercise" VALUES(11,'Windmills','Stand up with arms straight out to your sides with your feet wider than your hips.  With arms straight, touch your right hand to your left foot.  Return to starting position and switch sides.  Do 40 repetitions.','https://www.youtube.com/watch?v=P70Va8OmL-M',13,0,'2017-05-08 11:53:05');
INSERT INTO "daily_digest_exercise" VALUES(12,'Hindu Squat','Stand with feet hip width apart and arms straight out in front of you.  Sweep your arms back and brush your fingertips on the floor as you bend from your knees.  Stand back up to the starting position and repeat 20 times.','https://www.youtube.com/watch?v=EBFclPUYaCg',13,0,'2017-05-09 11:53:03');
INSERT INTO "daily_digest_exercise" VALUES(13,'Rolling Spine','Stand up with arms straight up.  Rolling each vertebrae separately, bend over and touch your toes.  Hold briefly and roll back up to starting position.  Repeat 20 times.','https://www.youtube.com/watch?v=VpQ9SPwNPvY',13,0,'2017-05-10 11:53:01');
INSERT INTO "daily_digest_exercise" VALUES(14,'Superman','Lie face down on the floor.  Extend your arms forward and lift your elbows and knees up.  Hold briefly and then release.  Repeat 20 times.','https://www.youtube.com/watch?v=z6PJMT2y8GQ',13,0,'2017-05-11 11:53:01');
INSERT INTO "daily_digest_exercise" VALUES(15,'Burpees','From standing, squat down and put hands on the floor.  Kick back into a pushup position, do a pushup then return to the squat.  Jump up and repeat 20 times.','https://youtu.be/yVwlpYvNYHk?t=110',13,0,'2017-05-12 11:52:53');
INSERT INTO "daily_digest_exercise" VALUES(16,'Knee Circles','While standing, lift a knee above your waist then swing it outward to your side before returning it to the starting position.  Switch legs and repeat 20 times.','https://www.youtube.com/watch?v=4g6OE5lrCsU',13,0,'2017-05-13 11:52:56');
INSERT INTO "daily_digest_exercise" VALUES(17,'Duck Walk','Squat down.  Walk forward while keeping your butt low.  Continue for 40 steps.','https://youtu.be/14BjRxE7f1o?t=7',13,0,'2017-05-14 11:52:54');
INSERT INTO "daily_digest_exercise" VALUES(18,'Crab Walk','Sit down with hands behind you.  Push up with your hips and walk forward.  Continue for 40 steps.','https://youtu.be/14BjRxE7f1o?t=80',13,0,'2017-05-15 11:52:58');
INSERT INTO "daily_digest_exercise" VALUES(19,'Monkey Roll','Downward facing dog starting point.  In a pike position with straight arms, kick up and swing your straight legs to the right.  Reset and repeat to the left.  Do this 20 times.','https://youtu.be/14BjRxE7f1o?t=275',13,0,'2017-05-16 11:52:59');
